import React from "react";
import { useRef } from "react";

export const Keyword_popup = (props) => {

    const ref = useRef('')

    return <div className='Keyword_popup_Closed'>
    <div> {props.option} </div>
    <div>Keyword to Add</div>

    <input ref={ref} className="Keyword_popup_input" ></input>
    <br></br>
    <button className="Keyword_popup_button" >Add</button>

</div>

}

export default Keyword_popup
